   		&lt;property name="driverClassName" value="org.hsqldb.jdbcDriver" /&gt;
   		&lt;property name="url" value="jdbc:hsqldb:mem:mymemdb" /&gt;
   		&lt;property name="username" value="SA" /&gt;
   		&lt;property name="password" value="" /&gt;&lt;/bean&gt;

в конфиг xml можно указывать properties file

```
      &lt;bean id="dataSource" class="org.springframework.jdbc.datasource.DriverManagerDataSource"&gt;
          &lt;property name="driverClassName" value="org.hsqldb.jdbcDriver" /&gt;
          &lt;property name="url" value="jdbc:hsqldb:mem:mymemdb" /&gt;
          &lt;property name="username" value="SA" /&gt;
          &lt;property name="password" value="" /&gt;
      &lt;/bean&gt;
```
в value потом вписываются значения из properties ${driverClassName} и т.д.

&lt;?xml version="1.0" encoding="UTF-8"?&gt;
&lt;beans 	xmlns="<http://www.springframework.org/schema/beans>"
		xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance"
		xmlns:context="http://www.springframework.org/schema/context"
		xmlns:tx="http://www.springframework.org/schema/tx"
		xmlns:security="http://www.springframework.org/schema/security"
		xmlns:mvc="http://www.springframework.org/schema/mvc"
    	xsi:schemaLocation="http://www.springframework.org/schema/beans
    						http://www.springframework.org/schema/beans/spring-beans-4.1.xsd
    						http://www.springframework.org/schema/mvc
    						http://www.springframework.org/schema/mvc/spring-mvc-4.1.xsd
    						http://www.springframework.org/schema/context
    						http://www.springframework.org/schema/context/spring-context-4.1.xsd
    						http://www.springframework.org/schema/tx
    						http://www.springframework.org/schema/tx/spring-tx-4.1.xsd
    						http://www.springframework.org/schema/security
    						http://www.springframework.org/schema/security/spring-security-4.0.xsd"&gt;

   	&lt;bean id="dataSource" class="org.springframework.jdbc.datasource.DriverManagerDataSource"&gt;
   		&lt;property name="driverClassName" value="org.hsqldb.jdbcDriver" /&gt;
   		&lt;property name="url" value="jdbc:hsqldb:mem:mymemdb" /&gt;
   		&lt;property name="username" value="SA" /&gt;
   		&lt;property name="password" value="" /&gt;
   	&lt;/bean&gt;

   	&lt;bean id="sessionFactory" class="org.springframework.orm.hibernate4.LocalSessionFactoryBean" &gt;
   		&lt;property name="dataSource" ref="dataSource" /&gt;
   		&lt;property name="packagesToScan" value="com.mp.entity" /&gt;
   		&lt;property name="configLocations" value="/WEB-INF/hibernate.cfg.xml" /&gt;
   	&lt;/bean&gt;

   	&lt;bean id="transactionManager" class="org.springframework.orm.hibernate4.HibernateTransactionManager" &gt;
   		&lt;property name="sessionFactory" ref="sessionFactory" /&gt;
   	&lt;/bean&gt;

   	&lt;tx:annotation-driven transaction-manager="transactionManager" /&gt;

   	&lt;context:component-scan base-package="com."/&gt;

   	&lt;mvc:annotation-driven /&gt;

   	&lt;mvc:resources location="/resources/" mapping="/resources/**"  /&gt;

	&lt;bean class="org.springframework.web.servlet.view.InternalResourceViewResolver" &gt;
		&lt;property name="prefix" value="/WEB-INF/views/" /&gt;
		&lt;property name="suffix" value=".jsp" /&gt;
	&lt;/bean&gt;




&lt;/beans&gt;

